import React, { Component } from "react";

class Component1 extends Component {
  state = {
    count: 0,
    url:
      "https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.pexels.com%2Fphoto%2Fblack-dslr-camera-with-black-background-1251299%2F&psig=AOvVaw3SRlztYJ5w1N86sNwXGuPe&ust=1586347134137000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCKD10N2h1ugCFQAAAAAdAAAAABAD",
  };

  styles = {
    fontSize: 50,
    fontWeight: 10,
  };

  render() {
    let calsses = this.getClass();

    return (
      <React.Fragment>
        <span style={this.styles} className={this.classes}>
          src={this.func()}
        </span>
        <button className="btn btn-secondary btn-sm"> press here</button>
      </React.Fragment>
    );
  }
  getClass() {
    let classes = "badge m-2 badge-";
    return (classes += this.state.count === 0 ? "primary" : "warning");
  }

  func() {
    return "zero";
  }
}

export default Component1;
